import { Routes, Route } from "react-router-dom";
import Editor from "./Editor"
import Home from './Home';

function App() {
  let docId = null

  return (
    <div className="App">
      <Routes>
        <Route path="/" element={<Home/>} />
        <Route path="/editor" element={
        <Editor
            id={docId}
        />} />
      </Routes>
    </div>
  );
}

export default App;
